/* eslint-disable */

import { useEffect, useState } from 'react';

// material-ui
import { Grid } from '@mui/material';
// project imports

import DonationCard from './DonationCard';
import DonationTextCard from './DonationTextCard';
import TextCard from './TextCard';

import HeaderCard from './HeaderCard';
import { gridSpacing } from 'store/constant';

// ==============================|| DEFAULT DASHBOARD ||============================== //

const tfgInfo = () => {
    const [isLoading, setLoading] = useState(true);
    useEffect(() => {
        setLoading(false);
    }, []);

    return (
        // dos filas
        <Grid container spacing={gridSpacing}>
            {/* fila 1 */}
            <Grid item xs={12}>
                {/* 3 columnas */}
                <Grid container spacing={gridSpacing}>
                    {/* columna 1 */}
                    <Grid item lg={4} md={6} sm={6} xs={12}>
                        <HeaderCard isLoading={isLoading} />
                    </Grid>
                    {/* columna 2 */}
                    <Grid item lg={4} md={6} sm={6} xs={12}>
                        <DonationCard isLoading={isLoading} />
                    </Grid>
                    {/* columna 3 */}
                    <Grid item lg={4} md={12} sm={12} xs={12}>
                        {/* texto donar */}   
                        <DonationTextCard isLoading={isLoading} />
                    </Grid>
                </Grid>
            </Grid>
            {/* fila 2 */}
            <Grid item xs={12}>
                 {/* 2 columnas */}
                <Grid container spacing={gridSpacing}>
                    {/* texto tfg */}
                    <Grid item xs={12} md={8}>
                        <TextCard isLoading={isLoading} />
                    </Grid>
                    {/* personas */}
                    <Grid item xs={12} md={4}>
                        {/* miembros del proyecto */}
                        <Grid item sm={6} xs={12} md={6} lg={12}>
                            <MemberCard isLoading={isLoading} />
                        </Grid>
                        <Grid item sm={6} xs={12} md={6} lg={12}>
                        </Grid>
                        <Grid item sm={6} xs={12} md={6} lg={12}>
                        </Grid>
                        <Grid item sm={6} xs={12} md={6} lg={12}>
                        </Grid>
                        <Grid item sm={6} xs={12} md={6} lg={12}>
                        </Grid>
                        <Grid item sm={6} xs={12} md={6} lg={12}>
                        </Grid>

                    </Grid>
                </Grid>
            </Grid>
        </Grid>
    );
};


export default tfgInfo;
